apiVersion: apps/v1
kind: Deployment
metadata:
  name: stripes-medad-k8s-custom-stg
  namespace: folio
spec:
  progressDeadlineSeconds: 600
  replicas: 1
  revisionHistoryLimit: 10
  selector:
    matchLabels:
      workload.user.cattle.io/workloadselector: deployment-folio-stripes-medad-k8s-custom-stg
  template:
    metadata:
      creationTimestamp: null
      labels:
        workload.user.cattle.io/workloadselector: deployment-folio-stripes-medad-k8s-custom-stg
      namespace: folio
    spec:
      containers:
        - env:
            - name: CLIENT_LOGO
              value: 
            - name: OKAPI_URL
              value: https://okapi.dev.mynaseej.net
            - name: TENANT_NAME
              value: medad
            - name: test
              value: test
            - name: CLIENT_LOGO_AR
              value: 
            - name: CLIENT_LOGO_LIGHT_AR
              value: 
            - name: CLIENT_LOGO_LIGHT_EN
              value: 
            - name: CLIENT_LOGO_EN
              value: 
          image: jed.ocir.io/axhxgarudf1b/medad-ils-ui:v3.9.0-3.55.0
          imagePullPolicy: IfNotPresent
          livenessProbe:
            failureThreshold: 10
            httpGet:
              path: /
              port: 80
              scheme: HTTP
            initialDelaySeconds: 10
            periodSeconds: 10
            successThreshold: 1
            timeoutSeconds: 1
          name: stripes-medad-k8s-custom-stg
          ports:
            - containerPort: 80
              name: 80tcp802
              protocol: TCP
          readinessProbe:
            failureThreshold: 10
            httpGet:
              path: /
              port: 80
              scheme: HTTP
            initialDelaySeconds: 10
            periodSeconds: 10
            successThreshold: 1
            timeoutSeconds: 1
          resources:
            limits:
              cpu: "1"
              memory: 6000Mi
            requests:
              cpu: 100m
              memory: 512Mi
          securityContext:
            allowPrivilegeEscalation: false
            capabilities: {}
            privileged: false
            readOnlyRootFilesystem: false
            runAsNonRoot: false
          startupProbe:
            failureThreshold: 30
            httpGet:
              path: /
              port: 80
              scheme: HTTP
            initialDelaySeconds: 300
            periodSeconds: 30
            successThreshold: 1
            timeoutSeconds: 1
          stdin: true
          terminationMessagePath: /dev/termination-log
          terminationMessagePolicy: File
          tty: true
      dnsPolicy: ClusterFirst
      imagePullSecrets:
        - name: oracle-reg
      restartPolicy: Always
      schedulerName: default-scheduler
      securityContext: {}
      terminationGracePeriodSeconds: 30
